Грузоперевозки по России и в страны Таможенного Союза любой степени сложности с крупнейшей российской транспортной компанией. Управляйте логистическими операциями прямо со своего смартфона с мобильным приложением «Деловые Линии».

Группа компаний «Деловые Линии», крупнейший в России транспортно-логистический оператор, была основана в 2001 году в Санкт-Петербурге. Начав свою деятельность как небольшая транспортная компания, за 15 лет развития стала абсолютным лидером на рынке грузоперевозок России.

ПРИЛОЖЕНИЕ ПОМОЖЕТ ВАМ:
- Рассчитывать стоимость и сроки грузоперевозок;
- Оформлять заказы на грузоперевозки;
- Оплачивать грузоперевозки банковскими картами;
- Отслеживать статусы своих заказов;
- Находить ближайшие терминалы;
- Узнавать графики работы терминалов и графики отправки грузов;
- Заказывать доставку груза до адреса;
- Узнавать ориентировочные даты прибытия грузов;
- Быть в курсе самых свежих новостей, акций и предложений.

